import MyImage from './images/image8.png';
import './App.css';
// import Image from './images/image8.png';

function App() {
  return (
    <div className="App">
      <div className="bar">mogu</div>
      <div className="image-container">
        <img src={MyImage} alt="Description" />
      </div>
      <div className="text">
        <b>인하대학교 IVC 소속 스타트엄 팀 모구입니다</b>
        <b>프로젝트를 함께 진행할 개발자 / 디자이너를 mogu와 함께 모집하고 구해보세요!</b>
      </div>

    </div>
  );
}

export default App;
